import heapq


dx = [0, 1, 0, -1]
dy = [1, 0, -1, 0]
for tc in range(1, int(input())+1):
    N = int(input())
    m = [0] * N
    for i in range(N):
        m[i] = list(map(int, input().split()))

    d = [[9876543210] * N for _ in range(N)]
    visited = [[0] * N for _ in range(N)]
    d[0][0] = 0
    visited[0][0] = 1

    tmp = []
    heapq.heappush(tmp, (d[0][0], 0, 0))
    while tmp:
        tmpd, x, y = heapq.heappop(tmp)
        visited[x][y] = 1

        for i in range(4):
            tmpx, tmpy = x + dx[i], y + dy[i]
            if 0 <= tmpx < N and 0 <= tmpy < N and not visited[tmpx][tmpy]:
                tmpm = m[tmpx][tmpy] - m[x][y]
                if tmpm < 0:
                    tmpm = 0
                if d[tmpx][tmpy] > d[x][y] + tmpm + 1:
                    d[tmpx][tmpy] = d[x][y] + tmpm + 1
                    heapq.heappush(tmp, (d[tmpx][tmpy], tmpx, tmpy))
    print(f"#{tc} {d[N - 1][N - 1]}")

